Adding Mozilla Input to knownurls.txt

Mozilla Input's contribute.json file can be found at the link below;
https://input.mozilla.org/contribute.json

pullsbody:
@ossreleasefeed or @pmclanahan r?

Now it looks like this:
![screenshot 2014-09-05 10 51 08](https://cloud.githubusercontent.com/assets/26739/4169223/3f18106c-3525-11e4-97d7-2b62501d80b3.png)

@pmclanahan r?

So, we used to have a two `contribute.json`. I guess we thought we'd have one for the project and one for the validator app. That's silly. 

Also, I wanted the `contribute.json` to exist in the root directory but to make it available in the stackato app, it'd have to copy from the parent directory into the stackato `./app` directory.

